import React, {useState} from 'react'

import imgSource from './resources/treeview.png';

const MainButton = (params, props) => {
    const [btnImage, setBtnImage] = useState([imgSource])
    const [onMouseOverValue, setonMouseOverValue] = useState([false])

    return(
        <picture className='Main-button-class' onMouseEnter={event => {
            setonMouseOverValue(true);
            // alert("hola");
            event.target.className.toggle("disabled");
        }}>
            
            <img src={params.source} width={'400px'} height={'auto'}/>
            <h4>{params.title}</h4>            
        </picture>
    );
};

export default MainButton;
